import React from 'react';
import Friend from './friend.js';

const FriendWrapp = props => {
  return (
    <div>
      {props.friends.map(friend => {
        const singleFriend = () => {
          props.history.push(`/friends/${friend.id}`);
        };
        return (
          <div>
            <Friend
              {...props}
              name={friend.name}
              age={friend.age}
              email={friend.email}
              key={friend.id}
              id={friend.id}
            />
            <button onClick={singleFriend}>Profile</button>
          </div>
        );
      })}
    </div>
  );
};

export default FriendWrapp;
